import Link from 'next/link'
import styless from './Example.module.css '

const NavBar = () => (

    <div className={styles.headerContainer1}>
        <Link href='/Home'>
            <a className={styles.headerContainer2}>Home</a>
        </Link>
    </div>
)

export default NavBar;
